Le commerce désigne l'activité économique d'achat et de revente de biens et de services, en particulier l'achat dans le but de revendre avec un profit ou un bénéfice. Le commerce a ses lois propres qui sont recueillies dans les Code de commerce et ses propres juridictions nationales ou internationales. Ayant d'autres finalités que de faire un profit, beaucoup d'activités économiques ou professionnelles comme l'éducation, la police, la culture, la médecine, la justice, l'architecture, la religion, etc. ne relèvent pas du domaine du commerce, mais des lois et des tribunaux civils ou administratif. Avec ses puissants relais d'opinion, l'Organisation mondiale du commerce (OMC) s'efforce d'étendre sa compétence et ses principes de profitabilité sur toutes les activités non commerciales en leur contestant le droit d'avoir des législations et des valeurs désintéressées. Il résulte du mouvement de spécialisation croissante qui affecte les sociétés humaines : 
* division technique du travail à l'échelon des postes de travail ; 
* division sociologique du travail à l'échelon des individus ou groupes d'individus ; 
* division internationale du travail à l'échelon des territoires et/ou des pays. Le développement de ces spécialisations explique pourquoi — en retour — les échanges et transactions se sont accrus : entre individus, entre organisations, ou entre individus et organisations (associations ou entreprises) sur un même ou entre territoires/pays. Le commerce est le prolongement naturel de l'activité de production de biens et services qui peuvent ainsi trouver un débouché dans la commercialisation en direction des marchés et clients potentiellement intéressés. Par extension, le terme « un commerce » est utilisé en français pour désigner le lieu d'exercice ou l'organisation dans lesquels les participants de cette activité pratiquent leur métier.
